const baseUrl = "http://localhost:3030/api";

export const register = (username, email, password, rePass) => {
	return fetch(`${baseUrl}/register`, {
		method: "POST",
		mode: "no-cors",
		headers: {
			"content-type": "application/json",
		},
		body: { email: email, username: username, password, rePass },
	}).then((res) => res.json());
};
